import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from './CardTextos';


export default function Body(){
    return (
        <div>
            <Row>
                
                <Col xs={6} md={4}>
                    <Card />
                </Col>
            </Row>
        </div>
    )

}
